A single enumeration member consists of a ( string , number ) group. Members within the enum block are defined using non static, const definitions, without destructuring and without a type annotation. The string and number values are corresponding to a String and a number. The value for string and number may be specified in different forms. If in any of the forms a component is omitted, the value is automatically assigned to that component. The values for the ( string , number ) group are given in the initializer of the const definition, as follows: const M;
const M = "string";
const M = number;
const M = ["string", number];
const M = [number, "string"]; In the presented forms, number must be a constant expression that is a number constant whose type is the representation type. It is a verify error if any of the following conditions are true: The member name already exists. The string already belongs to another member. The number already belongs to another member. If it is a Set enumeration and the number is not one or a power of two.

